  P2pOrderCreateRequest request, {
  RequestCompareFunction? comparePredicate,
}) =>
    _api.subscribe(request: request, comparePredicate: comparePredicate)!.map(
      (Response response) {
        checkException(
          response: response,
          exceptionCreator: ({BaseExceptionModel? baseExceptionModel}) =>
